import React, { Component } from "react";
import axios from "axios";
import {
  Container,
  Row,
  Col,
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  Button,
  Form,
  Input,
  InputGroup
} from "reactstrap";

import Layout from "../components/Layout";

class Books extends Component {
  constructor(props) {
    super(props);
    this.state = {
      allBooks: [],
      minPage: 0,
      maxPage: 4,
      searchValue: ""
    };
  }

  componentDidMount = () => {
    axios.get("http://localhost:4000/books/").then(res => {
      console.log(res);
    });
  };

  render() {
    return (
      <Layout>
        <div>
          <h1>Books</h1>
          <p>Application to view something</p>
        </div>
      </Layout>
    );
  }
}

export default Books;
